import React, {FC} from 'react';

import {Typography} from "antd";
import {Game} from "../types";

const Item: FC<Game> = ({id, creator}) => {
    return (
        <>
            <Typography.Text>{id} {creator}</Typography.Text>
        </>
    );
}

export default Item;
